import { useState } from "react";

export default function SignOut(props) {

  return (
    <form
			onSubmit={(e) => {
				e.preventDefault();
				handleRegister(formData);
			}}
		>
			<h3>Register</h3>
			<label>
				Username:
				<input
					type='text'
					name='username'
					value={username}
					onChange={handleChange}
				/>
			</label>
			<br />
			<label>
				Email:
				<input
					type='text'
					name='email'
					value={email}
					onChange={handleChange}
				/>
			</label>
			<br />
			<label>
				Password:
				<input
					type='password'
					name='password'
					value={password}
					onChange={handleChange}
				/>
			</label>
			<br />
			<button>Submit</button>
		</form>
  )
}
